import React from "react";
import { Route, Routes } from "react-router-dom"; // Switch を Routes に変更
import AdominLogin from "./Compornet/AdominLogin";
import AdminDashboard from "./Compornet/AdminDashboard";

function App() {
  return (
    <Routes>
      {" "}
      {/* Switch を Routes に変更 */}
      <Route path="/login" element={<AdominLogin />} />
      <Route path="/" element={<AdminDashboard />} />
      {/* 他のルート */}
    </Routes>
  );
}

export default App;
